package main

import (
	"fmt"
	"unicode"
)

func main() {
	SetupSwaps()
	fmt.Println("'' == ", Do("aA"))
	fmt.Println("'' == ", Do("abBA"))
	fmt.Println("c ==", Do("aAc"))
	fmt.Println("abAB ==", Do("abAB"))
	fmt.Println("dabCBAcaDA ==", Do("dabAcCaCBAcCcaDA"))
	fmt.Println("X ==", len(Do(input)))
	Solve("dabAcCaCBAcCcaDA")
	Solve(input)
}

func Solve(input string) {
	c := make(chan Answer)
	for i := 'a'; i <= 'z'; i++ {
		go Do2(input, i, c)
	}
	answers := []Answer{}
	for i := 0; i < 26; i++ {
		answers = append(answers, <-c)
	}
	length := 999999
	var final rune
	for _, a := range answers {
		if a.Length < length {
			length = a.Length
			final = a.Skip
		}
	}
	fmt.Println(string(final), ":", length)
}

type Answer struct {
	Skip   rune
	Length int
}

var swaps = map[rune]rune{}

func SetupSwaps() {
	for i := 'a'; i <= 'z'; i++ {
		upper := unicode.ToUpper(i)
		swaps[i] = upper
		swaps[upper] = i
	}
}

func Do(input string) string {
	reactions := 1
	polymer := []rune(input)
	for reactions > 0 {
		reactions = 0
		next := []rune{}
		i := 0
		for i < len(polymer) {
			if i+1 < len(polymer) && swaps[polymer[i]] == polymer[i+1] {
				i += 2
				reactions++
			} else {
				next = append(next, polymer[i])
				i++
			}
		}

		polymer = next
	}

	return string(polymer)
}

func Do2(input string, skip rune, output chan Answer) {
	reactions := 1
	polymer := []rune(input)
	upper := unicode.ToUpper(skip)
	next := []rune{}
	for i := range polymer {
		if polymer[i] == skip || polymer[i] == upper {
			// do nothing
		} else {
			next = append(next, polymer[i])
		}
	}
	polymer = next
	for reactions > 0 {
		reactions = 0
		next := []rune{}
		i := 0
		for i < len(polymer) {
			if i+1 < len(polymer) && swaps[polymer[i]] == polymer[i+1] {
				i += 2
				reactions++
			} else {
				next = append(next, polymer[i])
				i++
			}
		}

		polymer = next
	}
	output <- Answer{Skip: skip, Length: len(polymer)}
}

